import Employes from "./Components/Employes";
import { Detalis } from "./Components/Details.json";

function App() {
  return (
    <div className="w-8/12 h-screen bg-gray-100 mx-auto">
      <>
        <Employes name={Detalis.name} />
      </>
    </div>
  );
}

export default App;
